import logo from './logo.svg';
import { useEffect, useState } from "react";
import './App.css';

function App() {

  const nombre = 'nicolas'
  var numero = 12

  const [tarjeta, setTarjeta] = useState();


  useEffect(() => {
    fetch('http://localhost:8084/tarjetas/consultar?id=1015998520')
      .then((response) => response.json())
      .then((tarjeta) => {
       console.log(tarjeta)
       setTarjeta(tarjeta.pan)
      });
  }, []);


  return (
    <div className="App">
      <header className="App-header">
        <p>{tarjeta}</p>
        <p>{numero}</p>
      </header>
    </div>
  );
}

export default App;
